selector_to_html = {"a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ardc-binder-aaf-login.png\"><img alt=\"../../_images/ardc-binder-aaf-login.png\" src=\"../../_images/ardc-binder-aaf-login.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">ARDC Binder will ask you to log in using AAF</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tools\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tools<a class=\"headerlink\" href=\"#tools\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#next-steps\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Next steps<a class=\"headerlink\" href=\"#next-steps\" title=\"Link to this heading\">#</a></h2>", "a[href=\"../../other-digitised-resources/accessing-data.html#digitised-data-image-urls\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Constructing image urls using <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifiers<a class=\"headerlink\" href=\"#constructing-image-urls-using-nla-obj-identifiers\" title=\"Link to this heading\">#</a></h3><p>This is the most flexible method for downloading digitised images, but you need to know the <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier for the page or image you want to download. Once you have the identifier, it\u2019s just a matter of adding the appropriate suffix to construct a url that leads directly to the image file.</p><p>The suffixes are:</p>", "a[href=\"#converting-your-list\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Converting your list<a class=\"headerlink\" href=\"#converting-your-list\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#using-ardc-binder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using ARDC Binder<a class=\"headerlink\" href=\"#using-ardc-binder\" title=\"Link to this heading\">#</a></h4><p>To use the ARDC Binder service, click on the ARDC Binder tab under the notebook preview. You should see a big, blue <strong>Run live on ARDC Binder</strong> button. Click on the button to launch the Binder service.</p><p>If this is the first time you\u2019ve used the ARDC Binder service you\u2019ll be asked to login using the Australian Access Federation (AAF).</p>", "a[href=\"#trove-lists\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trove Lists<a class=\"headerlink\" href=\"#trove-lists\" title=\"Link to this heading\">#</a></h2><p>Creating</p><p>Adding notes and tags \u2013 some basic html in notes</p>", "a[href=\"#running-the-notebook\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Running the notebook<a class=\"headerlink\" href=\"#running-the-notebook\" title=\"Link to this heading\">#</a></h3><p>Go to <a class=\"reference external\" href=\"https://glam-workbench.net/trove-lists/convert-list-to-cb-exhibition/\">Convert a Trove list into a CollectionBuilder exhibition</a> in the Trove images section of the GLAM Workbench.</p><p>This notebook, like all GLAM Workbench notebooks, needs to be run in a customised computing environment. The easiest way to do this is through BinderHub. BinderHub is a cloud-based service that gets a notebook up and running by reading its requirements from a code repository, and creating an environment with the necessary software. The GLAM Workbench is integrated with two BinderHub services:</p>", "a[href=\"#sharing-a-trove-list-as-a-collectionbuilder-exhibition\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Sharing a Trove List as a CollectionBuilder exhibition<a class=\"headerlink\" href=\"#sharing-a-trove-list-as-a-collectionbuilder-exhibition\" title=\"Link to this heading\">#</a></h1><p>You\u2019ve been collecting and annotating items relating to your research project in a Trove List. You\u2019d like to display the contents of your list as an online exhibition for others to explore. <a class=\"reference external\" href=\"https://collectionbuilder.github.io/\">CollectionBuilder</a> creates online exhibitions using static web technologies. But how do you get your List data from Trove into CollectionBuilder?</p><p><img alt=\"\" src=\"../../_images/cb-wragge-demo.png\"/></p>", "a[href=\"#preparing-your-list-data-for-collectionbuilder\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Preparing your list data for CollectionBuilder<a class=\"headerlink\" href=\"#preparing-your-list-data-for-collectionbuilder\" title=\"Link to this heading\">#</a></h2><p>To create your CollectionBuilder exhibition you need a metadata file containing details of all the items in the exhibition, as well as any images associated with the items. The <a class=\"reference external\" href=\"https://glam-workbench.net/trove-lists/convert-list-to-cb-exhibition/\">Convert a Trove list into a CollectionBuilder exhibition</a> assembles all the necessary information from Trove and formats it ready for upload.</p><p>The notebook has three main outputs:</p>", "a[href=\"#preparing-your-collectionbuilder-repository\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Preparing your CollectionBuilder repository<a class=\"headerlink\" href=\"#preparing-your-collectionbuilder-repository\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#enriching-your-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Enriching your data<a class=\"headerlink\" href=\"#enriching-your-data\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#using-the-notebook-in-jupyter-lab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using the notebook in Jupyter Lab<a class=\"headerlink\" href=\"#using-the-notebook-in-jupyter-lab\" title=\"Link to this heading\">#</a></h3><p>No matter what service you use to run the notebook, the result will be the same \u2013 the notebook will open in the Jupyter Lab interface.</p>", "a[href=\"#iiif-nb-jupyterlab\"]": "<figure class=\"align-default\" id=\"iiif-nb-jupyterlab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-nb-jupyterlab.png\"><img alt=\"../../_images/iiif-nb-jupyterlab.png\" src=\"../../_images/iiif-nb-jupyterlab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">The notebook running in Jupyter Lab.</span><a class=\"headerlink\" href=\"#iiif-nb-jupyterlab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#gw-iiif-nb\"]": "<figure class=\"align-default\" id=\"gw-iiif-nb\">\n<a class=\"reference internal image-reference\" href=\"../../_images/gw-iiif-nb.png\"><img alt=\"../../_images/gw-iiif-nb.png\" src=\"../../_images/gw-iiif-nb.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">The GLAM Workbench provides a number of ways you can run the notebook.</span><a class=\"headerlink\" href=\"#gw-iiif-nb\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"../../other-digitised-resources/how-to/extract-embedded-metadata.html#digitised-howto-embedded-metadata-articles\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Articles<a class=\"headerlink\" href=\"#articles\" title=\"Link to this heading\">#</a></h4><p>Periodical issues can include a list of articles in the <code class=\"docutils literal notranslate\"><span class=\"pre\">article</span></code> field. Here\u2019s an example of an article entry from <em>Walkabout</em>:</p>", "a[href=\"#aaf-institutions-select\"]": "<figure class=\"align-default\" id=\"aaf-institutions-select\">\n<a class=\"reference internal image-reference\" href=\"../../_images/aaf-institutions-select.png\"><img alt=\"../../_images/aaf-institutions-select.png\" src=\"../../_images/aaf-institutions-select.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Select your institution from the AAF list</span><a class=\"headerlink\" href=\"#aaf-institutions-select\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-mybinder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using MyBinder<a class=\"headerlink\" href=\"#using-mybinder\" title=\"Link to this heading\">#</a></h4><p>To use the MyBinder service, click on the MyBinder tab under the notebook preview. You should see a big, blue <strong>Run live on MyBinder</strong> button. Click on the button to launch the Binder service. No login is required, so MyBinder immediately starts building a customised computing environment. This can take a while, but eventually the notebook should load in the Jupyter Lab interface.</p>", "a[href=\"#uploading-your-data-to-collectionbuilder\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Uploading your data to CollectionBuilder<a class=\"headerlink\" href=\"#uploading-your-data-to-collectionbuilder\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#mybinder-tab\"]": "<figure class=\"align-default\" id=\"mybinder-tab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mybinder-tab.png\"><img alt=\"../../_images/mybinder-tab.png\" src=\"../../_images/mybinder-tab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Click on the MyBinder tab.</span><a class=\"headerlink\" href=\"#mybinder-tab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
